import Card from "../components/shared/Card"

const AboutPage = () => {
    return (
        <Card>
            <div className="about">
                <h1>About this Project</h1>
                <p>This is a React App for leaving a Rating for our service</p>
                <p>Version 1.0.0</p>
            </div>
        </Card>
    )
}

export default AboutPage
